description:
Here is the next batch of sets from Fiona-Model. They are still off by a number (i.e. this is the 36th set, but it's numbered as set 35). Not sure what's going on there. I did find out, with help from Restless5, what the numbers after the file name mean... It's the companies way of keeping track of who might be sharing sets after DLing them. Evidently they are really cracking down on this. As such I've deleted all the goobly-gook after the main file number. This way should be safe to share. Hope you all enjoy!

